import React from 'react';

const Footer = () => {
    return (
        <footer className="bg-gray-800 text-white py-4 px-8 text-center ml-64 shadow-2xl relative z-[100] lg:ml-64 md:ml-20 sm:ml-0">
            <div className="max-w-5xl mx-auto">
                <p className="my-2 text-sm">&copy; {new Date().getFullYear()} Gym Management System. All rights reserved.</p>
                <p className="my-2 text-sm">Follow us on social media:</p>
                <ul className="flex justify-center gap-6 list-none p-0 m-0">
                    <li><a href="https://facebook.com" target="_blank" rel="noopener noreferrer" className="text-blue-400 no-underline hover:underline hover:text-blue-300">Facebook</a></li>
                    <li><a href="https://twitter.com" target="_blank" rel="noopener noreferrer" className="text-blue-400 no-underline hover:underline hover:text-blue-300">Twitter</a></li>
                    <li><a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="text-blue-400 no-underline hover:underline hover:text-blue-300">Instagram</a></li>
                </ul>
            </div>
        </footer>
    );
};

export default Footer;
